import React from 'react';
import './Footer.css';
const Footer = () => (




    <div className="Footer" id="page-top">




        {/* <!-- Footer--> */}
        <footer class="bg-light py-5">
            <div class="container px-4 px-lg-5">
                <div class="small text-center text-muted">
                    Copyright &copy; 2022 - CBondoc
                </div>
            </div>
        </footer>


    </div>





)
export default Footer;
